CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_update_periodo_carga` (IN `num_periodo_` INT, IN `num_anno_` INT, IN `fecha_inicio_` DATE, IN `fecha_final_` DATE, IN `Usuario_` VARCHAR(50), IN `id_periodo_` INT)  BEGIN

